import { Component } from '@angular/core';

@Component({
  selector: 'app-proyect',
  templateUrl: './proyect.component.html',
  styleUrls: ['./proyect.component.css']
})
export class ProyectComponent {

}
<div></div>
<div class="row">
    <div class="contenedorProyect1">
        <h1>Proyecto Workshop</h1>
        <p>Un proyecto armado solamente con JavaScript con el poposito de crear las funciones de un Workshop</p>
    </div>
    <div class="contenedorProyect2">
        <h1>Proyecto E-commerce Moontagne⛰</h1>
        <p>Un proyecto en donde se crea un E-commerce utilizando React Js, almacenando sus producto en Firebase</p>
    </div>
</div>
